import { FETCH_MOVIE } from "../actions/types";

// const INICIAL_STATE = {
//   isSignedIn: null,
//   userId: null
// };

export default (state = [], action) => {
  console.log(movies.payload);
  switch (action.type) {
    case FETCH_MOVIE:
      //   return { ...state, movies: movies.payload };
      return state;
    default:
      return state;
  }
};
